import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';


import {add_post, update_new_text} from "./redux/state/state";

export let rerender_entire_tree = (state) => {
    ReactDOM.render(
        <React.StrictMode> <App state={state} add_post={add_post} update_new_text={update_new_text}/>
        </React.StrictMode>,
        document.getElementById('root')
    );
}
